import React, {useEffect, useState} from 'react';
import {Img} from "./profilePost";

const ProfilePost = ({post, user}) => {
    const myPostMatch =  post.UserId === user.id;

    {
        myPostMatch
        && (<div>
            <Img src={post.img} />
        </div>)
    }
};

export default ProfilePost;
